import React from "react";
import mensImage from "../../assets/img/mensCollectionCover.jpg";
import classes from "./featuredProducts.module.css";

function FeaturedProducts({ featuredProduct }) {
  const shuffled = [...featuredProduct];
  shuffled.slice(0, 5);
  featuredProduct.slice(0,5)
  return (
    <div className={classes.card}>
      <img
        src={mensImage}
        alt={featuredProduct.name}
        className={classes.image}
      />
      <div className={classes.info}>
        <h3 className={classes.name}>{featuredProduct.name}</h3>
        <p className={classes.price}>${featuredProduct.price}</p>
        <button className={classes.cartBtn}>Add to Cart</button>
      </div>
    </div>
  );
}

export default FeaturedProducts;
